{"2": ["Насос пришёл . Всё ОК !", "2020-03-02T14:44:29.100022043Z", "синий", "15х8,5х14,5", 1, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "3": ["Развалилась поршневая, метал фольга!", "2020-01-26T09:10:26.715917981Z", "синий", "15х8,5х14,5", 1, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "4": ["Развалился поршень после некоторого времени использования( менее полугода) изредка подкачивая колеса \r\nДеньги на ветер ", "2019-12-13T20:20:21.529127047Z", "синий", "15х8,5х14,5", 2, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "7": ["Насос ужасный,манометр не работает,насадок в комплекте не было,хотя на коробке написано -есть в комплекте). Вернул через три минуты после покупки,деньги по сейчас не вернули,жду экспертизу,продаете бракованный товар , да еще надо теперь ждать свои деньги", "2019-12-07T06:38:16.031402645Z", "синий", "15х8,5х14,5", 2, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "8": ["Два раза велосипедные шины накачал , и всё! Насос устал. Думайте сами, брать ли эту игрушку.", "2019-12-05T11:31:18.359589795Z", "синий", "15х8,5х14,5", 1, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "9": ["Получил быстро, упаковка целая полный комплект работает нармально. По скидке просто отличный насос,а монометр если что и заменить можно, всё равно дешевле выходит чем в обычном магазине покупать.", "2019-10-14T18:22:20.988221022Z", "синий", "15х8,5х14,5", 3, 1, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "11": ["Насос отличный. Брали для накачивания колёс коляски, справояется с задачей на ура! Довольны. Вытащили из коробки когда, был сильный запах резины, полежал ночь на балконе и запах прошел.", "2019-10-22T04:49:57.623847157Z", "синий", "15х8,5х14,5", 1, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "12": ["В целом нормально, особенно за такую цену. Качал несколько раз и велосипед и автомобиль, пока полёт нормальный. Монометр правда погоду показывает, но это не критично для меня. И фиксаторный крючок бесит, постоянно попадает при накачивании между деталями и начинает мерзко хрустеть. Наконечник для накидывания на ниппель хлипенький пластмассовый, будьте осторожны при использовании, особенно в зимнее время. Благо заменить его не проблема, 5 рублей в автомагазинах. \r\nПри аккуратном обращении, я надеюсь, на долго хватит.", "2019-10-09T03:06:02.430300975Z", "синий", "15х8,5х14,5", 5, 0, 4, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "13": ["Насос пришел целым, функционирует хорошо.", "2019-08-21T17:35:41.068516076Z", "синий", "15х8,5х14,5", 2, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "15": ["Все работает, но манометр иногда живет своей жизнью", "2019-07-21T12:35:37.526091099Z", "синий", "15х8,5х14,5", 2, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "16": ["Очень  понравился. Добротный и в то же время лёгкий. Брала для велосипедов- справляется на ура!", "2019-07-17T15:50:17.231050648Z", "синий", "15х8,5х14,5", 1, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "17": ["очень хороший насос", "2019-03-23T08:35:05.419942889Z", "синий", "15х8,5х14,5", 2, 1, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "20": ["Качает хорошо, но ёрзает по полу, крепление, которое надевается на нипель хлипкое, посмотрим как долго прослужит, проверили на велике, быстрее в разы, чем ручным, есть насадка иголка для мячей и для фитболов, ещё какой-то переходник пластиковый.", "2019-03-10T17:30:23.521931392Z", "синий", "15х8,5х14,5", 15, 2, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "21": ["Спустя два месяца, периодически подкачивали мячи и воздушные шарики надували.", "2019-05-30T08:17:14.966040016Z", "синий", "15х8,5х14,5", 1, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "22": ["Не работает манометр ", "2019-05-26T10:22:53.574532257Z", "синий", "15х8,5х14,5", 1, 0, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "24": ["Отказался от товара пришол сломанный.", "2019-04-27T07:14:16.709556947Z", "синий", "15х8,5х14,5", 4, 1, 1, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "26": ["Насос пришел со сломанным барометром, отказ.", "2019-04-21T09:12:39.636651025Z", "синий", "15х8,5х14,5", 1, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "27": ["Качает шустро, а вот манометр не работает :(", "2019-04-20T13:21:31.728364126Z", "синий", "15х8,5х14,5", 4, 0, 2, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "28": ["Ужасный запах ! Насос три дня стоял на балконе , запах остался . Китайскими химикатами воняет жутко ! А так , вроде работает ..", "2019-04-13T07:23:18.962812084Z", "синий", "15х8,5х14,5", 2, 1, 3, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "29": ["По внешнему виду и расходникам замечаний нет. Подкачал два колеса на скутере, манометр показывает, сравнить нечем. По ощущению, конструкция хлипкая, посмотрим как дальше будет работать. Не понравилось, что фиксатор в сложенной состоянии - это изогнутая проволочка.", "2019-04-12T17:19:39.883687159Z", "синий", "15х8,5х14,5", 1, 0, 4, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "30": ["Хороший насос.Колеса на коляске накачал за 5сек.", "2019-03-28T09:44:52.735617247Z", "синий", "15х8,5х14,5", 0, 1, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"], "31": ["Насос в рабочем состоянии,насадки все подходят,компактный,додкачивает шины хорошо,надеюсь прослужит долго,спасибо WB", "2019-02-23T14:07:35.396845336Z", "синий", "15х8,5х14,5", 2, 0, 5, "Насос ножной двухцилиндровый с манометром, AutoStandart", "AutoStandart"]}
